import {Component} from "react";

class Control extends Component{
    constructor(props) {
      //key_id
      //secret_key
      //ticker
      //idChange
      //skChange
      //tickerChange

      super(props);

      this.tickerChange = this.tickerChange.bind(this);
      this.idChange = this.idChange.bind(this);
      this.skChange = this.skChange.bind(this);
      this.state = {
        };
    }

    tickerChange(e) {
      this.props.tickerChange(e.target.value);
    }
    idChange(e) {
      this.props.idChange(e.target.value);
    }
    skChange(e) {
      this.props.skChange(e.target.value);
    }

    render() {
      return (
        <div className="centered">
          <fieldset className="inputBox">
              <legend>Control Panel:</legend>

              <div>
              <label htmlFor="key">Key ID:</label>
              <input style={{float:"right", width:"350px", textAlign:"center"}} id="key" value={this.props.key_id} onChange={this.idChange}/>
              </div>

              <div>
              <label htmlFor="secret">Secret Key:</label>
              <input style={{float:"right", width:"350px", textAlign:"center"}} id="secret" value={this.props.secret_key} onChange={this.skChange}/>
              </div>

              <div>
              <label htmlFor="tck">Ticker:</label>
              <input style={{float:"right", width:"350px", textAlign:"center"}} id="tck" value={this.props.ticker} onChange={this.tickerChange}/>
              </div>
          </fieldset>
        </div>
      );
    }
  }

export default Control;
